webpackJsonp([0xb7be1b1c805d],{3170:function(e,n){e.exports={pathContext:{docHtml:'<h1>simple-swizzle <a href="https://travis-ci.org/Qix-/node-simple-swizzle"><img src="https://img.shields.io/travis/Qix-/node-simple-swizzle.svg?style=flat-square" alt="Travis-CI.org Build Status"></a> <a href="https://coveralls.io/r/Qix-/node-simple-swizzle"><img src="https://img.shields.io/coveralls/Qix-/node-simple-swizzle.svg?style=flat-square" alt="Coveralls.io Coverage Rating"></a></h1>\n<blockquote>\n<p><a href="https://en.wikipedia.org/wiki/Swizzling_(computer_graphics)">Swizzle</a> your function arguments; pass in mixed arrays/values and get a clean array</p>\n</blockquote>\n<h2>Usage</h2>\n<pre><code class="language-js">var swizzle = require(\'simple-swizzle\');\n\nfunction myFunc() {\n    var args = swizzle(arguments);\n    // ...\n    return args;\n}\n\nmyFunc(1, [2, 3], 4); // [1, 2, 3, 4]\nmyFunc(1, 2, 3, 4);   // [1, 2, 3, 4]\nmyFunc([1, 2, 3, 4]); // [1, 2, 3, 4]\n</code></pre>\n<p>Functions can also be wrapped to automatically swizzle arguments and be passed\nthe resulting array.</p>\n<pre><code class="language-js">var swizzle = require(\'simple-swizzle\');\n\nvar swizzledFn = swizzle.wrap(function (args) {\n    // ...\n    return args;\n});\n\nswizzledFn(1, [2, 3], 4); // [1, 2, 3, 4]\nswizzledFn(1, 2, 3, 4);   // [1, 2, 3, 4]\nswizzledFn([1, 2, 3, 4]); // [1, 2, 3, 4]\n</code></pre>\n<h2>License</h2>\n<p>Licensed under the <a href="http://opensource.org/licenses/MIT">MIT License</a>.\nYou can find a copy of it in <a href="LICENSE">LICENSE</a>.</p>',docPath:"argo-ci/node_modules/simple-swizzle/readme",proj:"argo-ci"}}}});
